import React, { Component } from "react";
// import { SocialIcon } from 'react-social-icons';


class JumbotronPage extends Component {

    render() {
      return (
        <Container fluid className="text-center flex-center w-responsive mx-auto text-white" style={{ fontFamily: "'Roboto Mono', monospace" }}>
        <Row className="mr-0 ml-0">
        <Col className="text-center pl-0 pr-0">
            <Jumbotron className="" style={{ backgroundColor: 'rgba(0,0,0,0.4)' }}>
            <h1>Suzie Stephen</h1>
            <h4>The Coding Bootcamp Student</h4>
            <Row className="social-icons">
                <Col>
                <SocialIcon className='social-icons' url="https://www.linkedin.com/in/suzie-stephen-b710129a/" target="_blank" rel="noopener noreferrer" />
                </Col>
                <Col>            
                    <SocialIcon className='social-icons' url="https://github.com/suziestephen" target="_blank" rel="noopener noreferrer" />
                </Col>
            </Row>
            </Jumbotron>
        </Col>
        </Row>
    </Container>

    )
  }
}
export default JumbotronPage;
